import React from "react";

function List() {
  return (
    <div className="cards">
      <div className="card">
        <img
          src="https://wallpapercave.com/uwp/uwp374924.jpeg"
          alt="Picture of series"
          className="card_img"
        />
        <div className="card_info">
          <span className="card_category">Netflix orignal series</span>
          <h3 className="card_title">Dark</h3>
          <a href="" target="_blank">
            <button> Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  );
}
export default List;
